import Para from './Para';

ReactDOM.render(
  <>
  <Heading/>
  <Para/>
  <ol>
    <li>namaste</li>
    <li>Hola</li>
    <li>Welcome</li>
  </ol>
  </>,
  document.getElementById('root')
);

